                clauses.append(f"{subject} is followed by {object_}")
            elif predicate == "precededBy":
                clauses.append(f"{subject} is preceded by {object_}")
            elif predicate == "capital":
                clauses.append(f"{subject}'s capital is {object_}")
            else:
                clauses.append(f"{subject}'s {predicate} is {object_}")

    sentence = ", ".join(clauses) + "."
